 stock sharing between tickets, take a look at %1$s for these features and more.'=>'Billets Commerce fournit une caisse de e-commerce simple et flexible pour l’achat de billets. Choisissez simplement votre passerelle de paiement et configurez les options de paiement et vous êtes prêt.  Si vous avez besoin de fonctionnalités plus avancées telles que les informations personnalisées sur les participants, l’enregistrement par code QR et le partage des stocks entre les billets, jetez un coup d’œil à %1$s pour ces fonctionnalités et plus encore.','Payment Gateways'=>'Passerelles de paiement','Set up a payment gateway to get started with Tickets Commerce. Enable multiple gateways for providing users additional options for users when purchasing tickets.'=>'Configurez une passerelle de paiement pour commencer à utiliser Billets Commerce. Activez plusieurs passerelles pour fournir aux utilisateurs des options supplémentaires lors de l’achat de billets.','Purchaser info'=>'Vos Coordonnées','Person purchasing tickets:'=>'Nom de la personne achetant des billets :','Email address'=>'Adresse e-mail','Your tickets will be sent to this email address'=>'Vos billets seront envoyés à cette adresse e-mail','Credit Cards'=>'Carte de crédit','Failed payments'=>'Echec de paiement','Payment methods accepted'=>'Méthode de paiement acceptés','Successful payments'=>'Payé avec succès','Pending payments'=>'Paiements en attente','You are using the free Stripe payment gateway integration. This includes an additional 2%% fee for processing ticket sales. This fee is removed if you have an active subscription to Event Tickets Plus. %1$s.'=>'Vous utilisez l’intégration gratuite de la passerelle de paiement Stripe. Cela comprend des frais supplémentaires de 2 %% pour le traitement des ventes de billets. Ces frais sont supprimés si vous avez un abonnement actif à Event Tickets Plus. %1$s.','Statement Descriptor'=>'Description au compte','This is the text that appears on the ticket purchaser bank statements. If left blank, the descriptor set in Stripe will be used.'=>'Il s’agit du texte qui apparaît sur les relevés bancaires de l’acheteur du billet. S’il n’est pas renseigné, le descripteur défini dans Stripe sera utilisé.','If this option is selected, ticket buyers will get Stripe receipts, as well as Event Tickets confirmation emails.'=>'Si cette option est sélectionnée, les acheteurs de billets recevront des reçus de stripe, ainsi que des e-mails de confirmation de billets d’évènement.','Checkout Type'=>'Type de commande','Accept only credit card payments.'=>'N’acceptez que les paiements par carte de crédit.','Accept credit card payments and additional payment methods configured in Stripe.'=>'Acceptez les paiements par carte de crédit et les modes de paiement supplémentaires configurés dans Stripe.','Credit Card field format'=>'Format du champ Carte de Crédit','Single field. %1$sFor streamlined checkout.%2$s'=>'Champ unique. %1$sPour une caisse simplifiée.%2$s','Multiple fields. %1$sFor standard checkout.%2$s'=>'Plusieurs champs. %1$s Pour le paiement standard.%2$s','AfterPay and ClearPay'=>'AfterPay et ClearPay','Alipay'=>'Alipay','Giropay'=>'Giropay','Klarna'=>'Klarna','Webhooks not validated yet.'=>'Les webhooks n’ont pas encore été validé.','Webhooks were properly validated for sales.'=>'Les webhooks ont été correctement validés pour les ventes.','Setting up webhooks will enable you to receive notifications on charge statuses and keep order information up to date for asynchronous payments. %1$sLearn more%2$s'=>'La configuration de webhooks vous permettra de recevoir des notifications sur l’état des frais et de maintenir les informations de commande à jour pour les paiements asynchrones. %1$s En savoir plus%2$s','Webhooks URL'=>'Crochets Web','Signing Secret'=>'Secret','Account deauthorized is not the same as account connected.'=>'Le compte désautorisé n’est pas le même que le compte connecté.','Payment Intent Test Successful'=>'Test d’intention de paiement réussi','Payment Intent %s does not correspond to a known order.'=>'L’intention de paiement %s ne correspond pas à un ordre connu.','Canceled payments'=>'Annulée','Created payments'=>'Paiements créés','Action required payments'=>'Paiements','Event %1$s was received but events of type %2$s are not currently handled.'=>'Les %1$s d’évènements ont été reçus, mais les évènements de type %2$s ne sont pas gérés actuellement.','Event was received but events of type %1$s are not currently handled.'=>'L’évènement a été reçu, mais les évènements de type %1$s ne sont pas actuellement gérés.','Tickets Commerce is configured to use %1$s as its currency but the default currency for the connected Stripe account is %2$s. Using different currencies for Tickets Commerce and Stripe may not be supported by all payment methods available in %1$s, and may result in exchange rates and conversions from %1$s to %2$s being handled by Stripe. If you believe this is an error, you can modify the Tickets Commerce currency in the main Payments tab.'=>'Billets Commerce est configuré pour utiliser %1$s comme monnaie, mais la monnaie par défaut du compte de bande connecté est %2$s. L’utilisation de monnaies différentes pour Billets Commerce et Stripe peut ne pas être prise en charge par toutes les méthodes de paiement disponibles dans %1$s, et peut entraîner des taux de change et des conversions de %1$s en %2$s gérés par Stripe. Si vous pensez qu’il s’agit d’une erreur, vous pouvez modifier la monnaie Billets Commerce dans l’onglet principal Paiements.','Stripe reports that it is unable to process charges with the selected Payment Methods. Usually this means that one of the methods selected is not available or not configured in your Stripe account. The errors you see below were returned from Stripe, please correct any inconsistencies or contact Stripe support, then try again: <div class="stripe-errors">%s</div>'=>'Stripe signale qu’il n’est pas en mesure de traiter les frais avec les modes de paiement sélectionnés. Cela signifie généralement que l’une des méthodes sélectionnées n’est pas disponible ou n’est pas configurée dans votre compte Stripe. Les erreurs que vous voyez ci-dessous ont été renvoyées par Stripe, veuillez corriger les incohérences ou contacter le support Stripe, puis réessayez : <div class="stripe-errors">%s</div>','Payment methods accepted cannot be empty'=>'Les modes de paiement acceptés ne peuvent pas être vides','Order ID (Payment Intent ID) in Stripe'=>'ID de commande (ID d’intention de paiement) dans Stripe','Client Secret from Stripe'=>'Clé secrète client de Stripe','Order ID in Stripe'=>'ID de commande','Completing the Stripe PaymentIntent failed. Please try again.'=>'L’exécution de Stripe PaymentIntent a échoué. Veuillez réessayer.','Creating new Stripe PaymentIntent failed. Please try again.'=>'La création de Stripe PaymentIntent a échoué. Veuillez réessayer.','Creating new Stripe order failed. Please try again.'=>'La création d’un nouvel ordre Stripe a échoué. Veuillez réessayer.','Due to Regulatory Issues between Stripe and the country listed in your Stripe account, the free version of Event Tickets cannot accept connections from accounts in your country. Please use a Stripe account from a different country or purchase Event Tickets Plus to continue.'=>'En raison de problèmes réglementaires entre Stripe et le pays indiqué dans votre compte Stripe, la version gratuite des billets d’évènement ne peut pas accepter les connexions provenant de comptes situés dans votre pays. Veuillez utiliser un compte Stripe d’un autre pays ou acheter des billets d’évènement Plus pour continuer.','Your Stripe account was disconnected from the Stripe dashboard. If you believe this is an error, you can re-connect in the %1$sPayments Tab of the Settings Page%2$s.'=>'Votre compte stripe a été déconnecté du tableau de bord Stripe. Si vous pensez qu’il s’agit d’une erreur, vous pouvez vous reconnecter dans l’onglet %1$sPaiements de la page Réglages%2$s.','Enable credit card payments, Afterpay, AliPay, Giropay, Klarna and more.'=>'Activez les paiements par carte de crédit, Afterpay, AliPay, Giropay, Klarna et plus encore.','PCI Compliance'=>'Conformité PCI','Stripe allows you to accept credit or debit cards directly on your website. Because of this, your site needs to maintain %1$sPCI-DSS compliance%2$s.'=>'Stripe vous permet d’accepter les cartes de crédit ou de débit directement sur votre site Web. Pour cette raison, votre site doit maintenir la conformité %1$sPCI-DSS%2$s.','Your connection is active, but Tickets Commerce is set to test mode. While in test mode no live transactions are processed.'=>'Votre connexion est active, mais Billets Commerce est configuré en mode test. En mode test, aucune transaction en direct n’est traitée.','Please provide a valid purchaser name and email.'=>'Veuillez fournir un nom d’acheteur et un e-mail valides.','Please provide a valid purchaser name.'=>'Veuillez fournir un nom d’acheteur valide.','Please provide a valid purchaser email.'=>'Veuillez fournir un e-mail d’acheteur valide.','Default checkout'=>'Moyen de paiement par défaut','Additional payment options'=>'Autres moyen de paiements','Enabled for Checkout'=>'Activé pour une commande','Enable payments through PayPal, Venmo, and credit card.'=>'Activez les paiements via PayPal, Venmo et carte de crédit.','Stripe'=>'Stripe','Stripe wasn\'t able to complete your connection request. Try again.'=>'Stripe n’a pas pu terminer votre demande de connexion. Réessayez.','Stripe signup was successful but the authentication tokens could not be retrieved. Try refreshing the tokens.'=>'L’inscription à Stripe a réussi, mais les jetons d’authentification n’ont pas pu être récupérés. Essayez d’actualiser les jetons.','Disconnecting from Stripe failed. Please try again.'=>'La déconnexion de Stripe a échoué. Veuillez réessayer.','Currency'=>'Devise','Your Stripe account is set to %1$s, but your Tickets Commerce site is set to %2$s. Using different currencies for Tickets Commerce and Stripe may not be supported by all payment methods available in %2$s, and may result in exchange rates and conversions from %2$s to %1$s being handled by Stripe.'=>'Votre compte Stripe est configuré sur %1$s, mais votre site Billets Commerce est configuré pour %2$s. L’utilisation de monnaies différentes pour Billets Commerce et Stripe peut ne pas être prise en charge par toutes les méthodes de paiement disponibles dans %2$s, et peut entraîner des taux de change et des conversions de %2$s en %1$s gérés par Stripe.','Please be sure to enable all the payment methods you want to use for this currency on your %1$sStripe dashboard%2$s.'=>'Assurez-vous d’activer tous les modes de paiement que vous souhaitez utiliser pour cette monnaie sur votre tableau de bord %1$sstripe%2$s.','Stripe currency:'=>'STRIPE monnaie :','Payments status:'=>'Statuts des Paiements :','Enabled'=>'Activé','Requirements'=>'Prénécessaire','Future Requirements'=>'Exigences','Learn more about configuring Stripe payments'=>'En savoir plus sur la configuration des paiements Stripe','Accept online payments with Stripe!'=>'Accepter les paiements en ligne par Stripe !','Start selling tickets to your events today with Stripe integration for Tickets Commerce. Enable highly-configurable credit and debit card checkout with enhanced features like Afterpay, AliPay, Degiro, Klarna and more.<br>'=>'Commencez à vendre des billets pour vos évènements dès aujourd’hui grâce à l’intégration de Stripe pour Billets Commerce. Activez le paiement par carte de crédit et de débit hautement configurable avec des fonctionnalités améliorées telles que Afterpay, AliPay, Degiro, Klarna et plus encore.<br>','Credit, debit card payments and more!'=>'Carte de crédit/débit et plus !','Easy, streamlined connection'=>'Mise à niveau facile','Stripe Logo Image'=>'Image du logo','You are now connected to Stripe! What\'s next?'=>'Vous êtes maintenant connecté à Stripe ! Quelle est la prochaine étape?','Be sur