es telles que les détails de la carte sur votre serveur et fonctionne de manière transparente avec les certificats SSL.','Compliance is comprised of, but not limited to:'=>'Activer les produits statiques limités','Using a trusted, secure hosting provider &mdash; preferably one which claims and actively promotes PCI compliance.'=>'Utiliser un fournisseur d’hébergement fiable et sécurisé, de préférence un fournisseur qui revendique et promeut activement la conformité PCI.','Implement an SSL certificate to keep your ticket sales secure.'=>'Mettez en place un certificat SSL pour sécuriser vos ventes de billets.','Keep WordPress and plugins up to date to ensure latest security fixes are present.'=>'Garder WordPress et les extensions à jour pour assurer que les derniers correctifs de sécurité sont présents.','Got it, thanks!'=>'J’ai compris, merci !','Tickets Checkout'=>'Commande de billets','Order Received!'=>'Commande reçue','Please add %1$s to check out.'=>'Ajoutez %1$s en finalisant.','Thank you. Your order has been received. A receipt for purchase and any digital %1$s ordered will be emailed to you shortly.'=>'Merci pour votre commande. Un accusé avec %1$s commandé vous sera envoyé prochainement.','back'=>'retour','back to %1$s'=>'Retour vers %1$s','Purchase %1$s'=>'Acheter %1$s','Oops, no %1$s!'=>'Oh là, pas de %1$s!','Get Started'=>'Pour commencer','Order #%1$s: %2$d %3$s reserved by %4$s (%5$s) on %6$s'=>'Commande #%1$s : %2$d %3$s requis par %4$s (%5$s) le %6$s','Checkout Unavailable!'=>'Paiement indisponible !','Checkout is not available at this time because a payment method has not been set up for this event. Please notify the site administrator.'=>'Le paiement n’est pas disponible pour le moment car aucun mode de paiement n’a été configuré pour cet évènement. Veuillez en informer l’administrateur du site.','Checkout Error!'=>'Erreur dans la commande !','Please %1$sbrowse %2$s%3$s and add %4$s to check out.'=>'Veuillez %1$snaviguer dans les %2$s%3$s et ajouter 