h the use of WooCommerce, Easy Digital Downloads, or PayPal'=>'Adresse de facturation de %s acheteur, qui est collectée via WooCommerce, Easy Digital Downloads ou PayPal','What personal data we collect and why we collect it'=>'Quelles sont les données personnelles que nous recueillons et pourquoi nous les collectons','This information is only for guidance and not to be considered as legal advice.'=>'Cette information est uniquement pour les lignes directrices et de ne pas être considérés comme des conseils juridiques.','Event Tickets REST API'=>'API REST de Event Tickets','No description provided'=>'Aucune description fournie','The ticket WordPress post ID'=>'Le billet de l’ID de la publication WordPress','Order Title'=>'Titre de la commande','Event Tickets RSVP Attendee Data'=>'Données des participants RSVP','Event Tickets RSVP Attendee'=>'Participant RSVP','Event Tickets TribeCommerce Attendee'=>'Tickets Participant','Event Tickets TribeCommerce Attendee Data'=>'Données des participants, Tickets, Commerce','Disclaimer:'=>'Avertissement :','If you create, submit, import, save, or publish event %1$s information, as well as obtain %2$s or purchase %3$s to events, such information is retained in the local database:'=>'Si vous créez, soumettez, importez, enregistrez ou publiez des informations sur l’évènement %1$s, ainsi que si vous obtenez %2$s ou achetez %3$spour des évènements, ces informations sont conservées dans la base de données locale :','Attendees information (%1$s and %2$s): name and email address'=>'Information sur les participants (%1$s et %2$s) : nom et e-mail','Please note: The website owner can collect nearly any Attendee Information requested from %s buyers by creating a custom registration form.'=>'Remarque : le propriétaire du site Web peut collecter presque toutes les informations sur les participants demandées aux acheteurs %s en créant un formulaire d’inscription personnalisé.','These API keys may include the following third party services: Google