, upgrade your license, or purchase a new one.'=>'Vous avez une clé de licence pour %1$s, mais la clé est en dehors des installations. %2$s visitez le site Web du calendrier des événements %3$s pour gérer vos installations, mettre à niveau votre licence ou en acheter une nouvelle.' . "\0" . 'Vous avez des clés de licence pour %1$s, mais les clés sont en dehors des installations. %2$s visitez le site Web du calendrier des événements %3$s pour gérer vos installations, mettre à niveau vos licences ou en acheter des nouvelles.','There is an update available for %1$s but your license has expired. %2$sVisit the Events Calendar website to renew your license.%3$s'=>'Une mise à jour est disponible pour %1$s mais votre licence a expiré. %2$s visitez le site web du Events Calendar pour renouveler votre licence.%3$s' . "\0" . 'Des mises à jours existent pour %1$s mais votre licence a expirée. %2$s Visitez le site internet de The Events Calendar pour la renouveler.%3$s',' (opens in a new window)'=>' (s’ouvre dans une nouvelle fenêtre)',': Selected 1 row'=>': 1 rangée sélectionnée','All'=>'Tout','No matching records found'=>'Aucun enregistrements correspondants trouvés','(filtered from _MAX_ total entries)'=>'(filtré de _MAX_ éléments au total)','Showing 0 to 0 of 0 entries'=>'Affiche 0 à 0 de 0 entrées','Showing _START_ to _END_ of _TOTAL_ entries'=>'Affichage de _START_ à _END_ sur _TOTAL_ éléments','No data available in table'=>'Aucune donnée disponible dans le tableau','Show _MENU_ entries'=>'Afficher _MENU_ éléments',': activate to sort column descending'=>': activer pour trier la colonne par ordre décroissant',': activate to sort column ascending'=>': activer pour trier la colonne par ordre croissant','An Unknown error occurred'=>'Une erreur inconnue s\'est produite','Renew Your License Now'=>'Renouvelez votre licence maintenant','Event Aggregator'=>'Event Aggregator','Return to WordPress Updates'=>'Retour au mises à jour WordPress','Go to WordPress Updates page'=>'Aller à 