s enregistré ou mis à jour le message.','Email:'=>'E-mail&nbsp;:','Full Name'=>'Nom','RSVP'=>'RSVP','Out of stock!'=>'Plus de place disponible !','Attendee List'=>'Liste de participants','Your tickets'=>'Vos tickets','Purchaser'=>'Acheteur','Stock'=>'Stock','Cancel'=>'Annuler','When will ticket sales occur?'=>'Quand la vente des billets doit-elle avoir lieu ?','If you don\'t set a start/end date for sales, tickets will be available from now until the event ends.'=>'Si vous ne réglez pas de date de début/fin de la vente, les billets seront disponibles dès maintenant et jusqu\'à la fin de l’événement.','Add new ticket'=>'Ajouter un nouveau billet','Edit ticket'=>'Modifier ticket','Start sale:'=>'Date de début de vente :','End sale:'=>'Date de fin de vente :','Sell using:'=>'Vendre en utilisant :','Edit in %s'=>'Modifier dans %s','Select an Image'=>'Sélectionner une image','Remove'=>'Retirer','The maximum image size in the email will be 580px wide by any height, and then scaled for mobile. If you would like "retina" support use an image sized to 1160px wide.'=>'La taille maximale de l’image dans l’e-mail sera 580px large par n’importe quelle hauteur, puis mis à l’échelle pour mobile. Si vous souhaitez « retina» prise en charge utiliser une image de taille à 1160px large.','View'=>'Vues','(0 or empty for free tickets)'=>'(0 ou vide pour des billets gratuits)','Edit'=>'Modifier','Sale Price:'=>'Prix de vente :','(Current sale price - this can be managed via the product editor)'=>'(Prix de vente actuel - cela peut être géré via l’éditeur de produit)','Checked in'=>'Coché','Price:'=>'Prix :','Send Email'=>'Envoyer','Email Address:'=>'Adresse e-mail :','Select...'=>'Selectionnez...','or'=>'ou','Error when sending the email'=>'Erreur lors de l’envoi de l’e-mail','Email sent successfully!'=>'E-mail bien envoyé !','Send the attendee list by email'=>'Envoyer la liste des participants par mail','Select a User:'=>'Sélectionner l’utilisateur/utilisatrice :','Attendee List for: %s'=>'Liste des participants pour : %s','attendees'=>'participants','Invalid User ID'=>'Identifiant utilisateur non valide','Invalid Event ID'=>'ID de l’évènement non valide','Cheatin Huh?'=>'Mmm… On essaye de tricher ?','Empty user and/or email'=>'Utilisateur et e-mail vide','Invalid Email'=>'Email non valide','Yes'=>'Oui','You can use Screen Options to select which columns you want to see. The selection works in the table below, in the email, for print and for the CSV export.'=>'Vous pouvez utiliser les options d’écran pour choisir quelle colonne vous souhaitez rendre visibles. La sélection fonctionne pour le tableau ci-dessous, pour l’e-mail, l’impression et pour l’export CSV.','Post draft updated.'=>'Le brouillon de l&rsquo;article a été mis à jour.','See who purchased tickets to this event'=>'Voir qui a acheté des tickets pour cet événement','Attendees'=>'Participants','Columns'=>'Colonnes','Sending...'=>'Envoi...','You need to select a user or type a valid email address'=>'Vous devez choisir un utilisateur/utilisatrice ou insérer une adresse e-mail valide','(deleted)'=>'(supprim&eacute;)','Post submitted.'=>'Article envoyé.','Features overview'=>'Aperçu des fonctionnalités','Post published. %1$s'=>'Publication publiée. %1$s','Post updated. %1$s'=>'Article mis à jour. %1$s','In order to %s, you must enter your name and a valid email address.'=>'Pour %s, vous devez entrer votre nom et une adresse e-mail valide.','Attendee numberAttendee %1$s'=>'Participant %1$s','If you have a valid license for one of our paid plugins, you can %s in our premium support forums. Our support team monitors the forums and will respond to your thread within 24-48 hours (during the week).'=>'Si vous disposez d’une licence valide pour un de nos modules payants, vous pouvez %s dans notre forum de support premium. Notre équipe support suit les forums et réponds à vos questions dans un délai de 24 à 48 heures (en semaine).','If you have tried the above steps and are still having trouble, you can post a new thread to our %s. Our support staff monitors these forums once a week and would be happy to assist you there.'=>'Si vous avez essayé les étapes ci-dessus et que le problème persiste, vous pouvez publier une nouvelle discussion sur notre %s. Notre personnel de soutien surveille ces forums une fois par semaine et serait heureux de vous aider.','open-source forum on WordPress.org'=>'forum open-source de WordPress.org','Customizing Event Tickets'=>'Customiser Event Tickets','Troubleshooting common problems'=>'Dépannage des problèmes connus','Settings overview'=>'Aperçu des réglages','Support for Event Tickets'=>'Support pour Event Tickets','Return to the %1$sAttendees Report%2$s.'=>'Retour vers %1$s Rapport des participants %2$s.','premium support on our website'=>'support Premium sur notre site Web','Already have Event Tickets Plus? You can %s in our premium support forums. Our support team monitors the forums and will respond to your thread within 24-48 hours (during the week).'=>'Vous avez déjà des billets d’évènement Plus ? Vous pouvez %s dans nos forums de soutien premium. Notre équipe de support surveille les forums et répondra à votre fil dans les 24-48 heures (pendant la semaine).','Your %1$s has been received! Check your email for your %1$s confirmation.'=>'Votre %1$s a été bien reçu ! Vérifiez votre e-mail pour la confirmation de %1$s.','You can\'t %1$s more than the total remaining %2$s.'=>'Vous ne pouvez pas %1$s de plus que le total restant %2$s.','Post scheduled.'=>'Article planifié.','post a thread'=>'poster un ticket','New User Primer'=>'Guide de départ du nouvel utilisateur','When The Events Calendar and Event Tickets are both activated, The Events Calendar must be running version %1$s or greater. Please %2$supdate now.%3$s'=>'Lorsque The Events Calendar et Events Tickets sont tous deux activés, The Events Calendar doit être en version %1$s ou plus. S’il vous plaît %2$s mettez à jour maintenant.%3$s','(Event Tickets Plus)'=>'(Events Tickets Plus)','Delete'=>'Supprimer','Export'=>'Exportation','Email'=>'E-mail','Check in'=>'Enregistrement du participant','Print'=>'Imprimer','Undo Check in'=>'Annuler l’enregistrement','Ticket #'=>'N° du ticket','Security Code'=>'Code de sécurité','Purchaser Email'=>'Email de l’acheteur','Tickets'=>'Billets','This is where all of the global network settings for Event Tickets can be modified.'=>'C’est là que tous les réglages réseau globaux des billets d’évènement peuvent être modifiés.','Hide the following settings tabs on every site:'=>'Masquer les onglets de réglages suivants sur chaque site :','Purchaser Name'=>'Nom de l’acheteur','Network Settings'=>'Paramètres du réseau','Miscellaneous Settings'=>'Paramètres Divers','Debug Bar Plugin'=>'Plugin Debug Bar','Knowledgebase'=>'Base de connaissances','System Information'=>'Informations Syst&egrave;me','News and Tutorials'=>'Actu et tutoriels','More...'=>'Plus...','Read more about our support policy'=>'En savoir plus sur notre politique de support','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Veuillez noter que toute l’assistance pratique est fournie par l’intermédiaire du service d’assistance. Vous pouvez nous envoyer un courriel ou un tweet…. mais nous vous dirigerons probablement vers le service d’assistance.  😄','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Il y a très peu d’incidents que nous n’avons pas vu et il est probable qu’un autre utilisateur ai déjà posé votre question et obtenu une réponse de notre équipe de support. Alors que publier sur les forums est uniquement possible pour les clients payants, la consultation des sujets est ouverte à tous.','Test for a theme or plugin conflict'=>'Tester pour un conflit de thème ou d’extension','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. Test d’un conflit existant est le meilleur départ pour le dépannage en profondeur. Nous allons souvent vous demander de suivre ces étapes lors de l’ouverture d’un nouveau thread, ce faisant, cette avance sera super utile.','Check our Knowledgebase'=>'Visitez notre base de connaissance','%s. All of the common (and not-so-common) answers to questions we see are here. It’s often the fastest path to finding an answer!'=>'%s. Toutes les réponses communes aux questions que nous voyons sont ici. C’est souvent le chemin le plus rapide de trouver une réponse !','While the resources above help solve a majority of the issues we see, there are times you might be looking for extra support. If you need assistance using our plugins and would like us to take a look, please follow these steps:'=>'Alors que les ressources ci-dessus aident à résoudre la majorité des questions que nous voyons, vous cherchez peut-être un soutien supplémentaire. Si vous avez besoin d’aide en utilisant nos extensions et aimeriez jeter un coup d’oeil, s’il vous plaît suivez ces étapes :','Getting More Help'=>'Obtenir plus d’aide','list of available functions'=>'liste des fonctionnalités disponibles','Our website’s %s is a great place to find tips and tricks for using and customizing our plugins.'=>'Notre site %s est l’endroit idéal pour trouver des trucs et astuces pour utiliser et personnaliser nos extensions.','Getting Support'=>'Obtenir de l’aide','Thank you for using %s! All of us at The Events Calendar sincerely appreciate your support and we’re excited to see you using our plugins.'=>'Merci d’utiliser %s ! Chacun d’entre nous chez Modern Tribe apprécions sincèrement votre soutien et sommes heureux de vous voir utiliser nos extensions.','Debug mode'=>'Mode débogage','Enable this option to log debug information. By default this will log to your server PHP error log. If you\'d like to see the log messages in your browser, then we recommend that you install the %s and look for the "Tribe" tab in the debug output.'=>'Activer cette option pour enregistrer les informations de débogage. Par défaut les informations seront enregistrés sur le ficher d’enregistrement de votre serveur PHP (Error Log). Si vous souhaitez voir les messages enregistrés sur votre navigateur, nous vous recommandons d’installer  %s et de rechercher l’onglet « Tribe ».','West Virginia'=>'West Virginia','Wisconsin'=>'Wisconsin','Wyoming'=>'Wyoming','Tennessee'=>'Tennessee','Texas'=>'Texas','Utah'=>'Utah','Vermont'=>'Vermont','Virginia'=>'Virginie','Washington'=>'Washington','South Carolina'=>'Caroline du Sud','South Dakota'=>'Dakota du Sud','Pennsylvania'=>'Pennsylvanie','Rhode Island'=>'Rhode Island','Ohio'=>'Ohio','Oklahoma'=>'Oklahoma','Oregon'=>'Oregon','New York'=>'New York','North Carolina'=>'Caroline du Nord','North Dakota'=>'North Dakota','Nebraska'=>'Nebraska','Nevada'=>'Nevada','New Hampshire'=>'New Hampshire','New Jersey'=>'New Jersey','New Mexico'=>'Nouveau Mexique','Massachusetts'=>'Massachusetts','Michigan'=>'Michigan','Minnesota'=>'Minnesota','Mississippi'=>'Mississippi','Missouri'=>'Missouri','Montana'=>'Montana','Kentucky'=>'Kentucky','Louisiana'=>'Louisiane','Maine'=>'Maine','Maryland'=>'Maryland','Illinois'=>'Illinois','Indiana'=>'Indiana','Iowa'=>'Iowa','Kansas'=>'Kansas','Connecticut'=>'Connecticut','Delaware'=>'Delaware','District of Columbia'=>'District de Columbia','Florida'=>'Floride','Hawaii'=>'Hawaii','Idaho'=>'Idaho','Alabama'=>'Alabama','Alaska'=>'Alaska','Arizona'=>'Arizona','Arkansas'=>'Arkansas','California'=>'Californie','Colorado'=>'Colorado','Virgin Islands (British)'=>'Îles Vierges (britanniques)','Virgin Islands (U.S.)'=>'Îles Vierges (U.S.)','Western Sahara'=>'Sahara occidental','Yemen'=>'Y&ea